  let nOutputs = Int(1)
    let op = makeOp("Binary", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.addInput(a)
    op.addInput(b)
    return op.execute(Int(1))
}

/// Counts the number of occurrences of each value in an integer array.
///
/// Outputs a vector with length `size` and the same dtype as `weights`. If
/// `weights` are empty, then index `i` stores the number of times the value `i` is
/// counted in `arr`. If `weights` are non-empty, then index `i` stores the sum of
/// the value in `weights` at each index where the corresponding value in `arr` is
/// `i`.
///
/// Values in `arr` outside of the range [0, size) are ignored.
///
/// - Parameters:
///     - arr: int32 `Tensor`.
///     - size: non-negative int32 scalar `Tensor`.
///     - weights: is an int32, int64, float32, or float64 `Tensor` with the same
///         shape as `arr`, or a length-0 `Tensor`, in which case it acts as all weights
///         equal to 1.
///
/// - Output bins: 1D `Tensor` with length equal to `size`. The counts or summed weights for
///     each value in the range [0, size).
@inlinable @inline(__always)
public static func bincount<T: Numeric & TensorFlowScalar>(
    arr: Tensor<Int32>,
    size: Tensor<Int32>,
    weights: Tensor<T>
) -> Tensor<T> {
  let nOutputs = Int(1)
    let op = makeOp("Bincount", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.addInput(arr)
    op.addInput(size)
    op.addInput(weights)
    return op.execute(Int(1))
}

/// Bitcasts a tensor from one type to another without copying data.
///
/// Given a tensor `input`, this operation returns a tensor that has the same buffer
/// data as `input` with datatype `type`.
///
/// If the input datatype `T` is larger than the output datatype `type` then the
/// shape changes from [...] to [..., sizeof(`T`)/sizeof(`type`)].
///
/// If `T` is smaller than `type`, the operator requires that the rightmost
/// dimension be equal to sizeof(`type`)/sizeof(`T`). The shape then goes from
/// [..., sizeof(`type`)/sizeof(`T`)] to [...].
///
/// tf.bitcast() and tf.cast() work differently when real dtype is casted as a complex dtype
/// (e.g. tf.complex64 or tf.complex128) as tf.cast() make imaginary part 0 while tf.bitcast()
/// gives module error.
/// For example,
///
/// Example 1:
/// ```python
/// >>> a = [1., 2., 3.]
/// >>> equality_bitcast = tf.bitcast(a,tf.complex128)
/// tensorflow.python.framework.errors_impl.InvalidArgumentError: Cannot bitcast from float to complex128: shape [3] [Op:Bitcast]
/// >>> equality_cast = tf.cast(a,tf.complex128)
/// >>> print(equality_cast)
/// tf.Tensor([1.+0.j 2.+0.j 3.+0.j], shape=(3,), dtype=complex128)
/// ```
/// Example 2:
/// ```python
/// >>> tf.bitcast(tf.constant(0xffffffff, dtype=tf.uint32), tf.uint8)
/// <tf.Tensor: ... shape=(4,), dtype=uint8, numpy=array([255, 255, 255, 255], dtype=uint8)>
/// ```
/// Example 3:
/// ```python
/// >>> x = [1., 2., 3.]
/// >>> y = [0., 2., 3.]
/// >>> equality= tf.equal(x,y)
/// >>> equality_cast = tf.cast(equality,tf.float32)
/// >>> equality_bitcast = tf.bitcast(equality_cast,tf.uint8)
/// >>> print(equality)
/// tf.Tensor([False True True], shape=(3,), dtype=bool)
/// >>> print(equality_cast)
/// tf.Tensor([0. 1. 1.], shape=(3,), dtype=float32)
/// >>> print(equality_bitcast)
/// tf.Tensor(
/// [[ 0 0 0 0]
///  [ 0 0 128 63]
///  [ 0 0 128 63]], shape=(3, 4), dtype=uint8)
/// ```
///
/// *NOTE*: Bitcast is implemented as a low-level cast, so machines with different
/// endian orderings will give different results.
@inlinable @inline(__always)
public static func bitcast<
    T: Numeric & TensorFlowScalar,
    Type: Numeric & TensorFlowScalar
>(
    _ input: Tensor<T>
) -> Tensor<Type> {
  let nOutputs = Int(1)
    let op = makeOp("Bitcast", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("type", Type.tensorFlowDataType)
    op.addInput(input)
    return op.execute(Int(1))
}

/// Elementwise computes the bitwise AND of `x` and `y`.
///
/// The result will have those bits set, that are set in both `x` and `y`. The
/// computation is performed on the underlying representations of `x` and `y`.
@inlinable @inline(__always)
public static func bitwiseAnd<T: BinaryInteger & TensorFlowScalar>(
    _ x: Tensor<T>,
    _ y: Tensor<T>
) -> Tensor<T> {
