@inlinable @inline(__always)
public static func cudnnRNNBackpropV2<T: FloatingPoint & TensorFlowScalar>(
    _ input: Tensor<T>,
    inputH: Tensor<T>,
    inputC: Tensor<T>,
    params: Tensor<T>,
    output: Tensor<T>,
    outputH: Tensor<T>,
