/// Compute the cumulative product of the tensor `x` along `axis`.
///
/// By default, this op performs an inclusive cumprod, which means that the first
/// element of the input is identical to the first element of the output:
///
/// ```python
/// tf.cumprod([a, b, c])  # => [a, a * b, a * b * c]
/// ```
///
/// By setting the `exclusive` kwarg to `True`, an exclusive cumprod is
/// performed instead:
///
/// ```python
/// tf.cumprod([a, b, c], exclusive=True)  # => [1, a, a * b]
/// ```
///
/// By setting the `reverse` kwarg to `True`, the cumprod is performed in the
/// opposite direction:
///
/// ```python
/// tf.cumprod([a, b, c], reverse=True)  # => [a * b * c, b * c, c]
/// ```
///
/// This is more efficient than using separate `tf.reverse` ops.
///
/// The `reverse` and `exclusive` kwargs can also be combined:
///
/// ```python
/// tf.cumprod([a, b, c], exclusive=True, reverse=True)  # => [b * c, c, 1]
/// ```
///
/// - Parameters:
///     - x: A `Tensor`. Must be one of the following types: `float32`, `float64`,
///         `int64`, `int32`, `uint8`, `uint16`, `int16`, `int8`, `complex64`,
///         `complex128`, `qint8`, `quint8`, `qint32`, `half`.
///     - axis: A `Tensor` of type `int32` (default: 0). Must be in the range
///         `[-rank(x), rank(x))`.
///
/// - Attrs:
///     - exclusive: If `True`, perform exclusive cumprod.
///     - reverse: A `bool` (default: False).
@inlinable @inline(__always)
public static func cumprod<
    T: Numeric & TensorFlowScalar,
    Tidx: BinaryInteger & TensorFlowScalar
>(
    _ x: Tensor<T>,
    axis: Tensor<Tidx>,
    exclusive: Bool = false,
    reverse: Bool = false
) -> Tensor<T> {
  let nOutputs = Int(1)
    let op = makeOp("Cumprod", nOutputs)
    op.updateAttribute("exclusive", exclusive)
    op.updateAttribute("reverse", reverse)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("Tidx", Tidx.tensorFlowDataType)
    op.addInput(x)
    op.addInput(axis)
    return op.execute(Int(1))
}

/// Compute the cumulative sum of the tensor `x` along `axis`.
///
/// By default, this op performs an inclusive cumsum, which means that the first
/// element of the input is identical to the first element of the output:
///
/// ```python
/// tf.cumsum([a, b, c])  # => [a, a + b, a + b + c]
/// ```
///
/// By setting the `exclusive` kwarg to `True`, an exclusive cumsum is
/// performed instead:
///
/// ```python
/// tf.cumsum([a, b, c], exclusive=True)  # => [0, a, a + b]
/// ```
///
/// By setting the `reverse` kwarg to `True`, the cumsum is performed in the
/// opposite direction:
///
/// ```python
/// tf.cumsum([a, b, c], reverse=True)  # => [a + b + c, b + c, c]
/// ```
///
/// This is more efficient than using separate `tf.reverse` ops.
///
/// The `reverse` and `exclusive` kwargs can also be combined:
///
/// ```python
/// tf.cumsum([a, b, c], exclusive=True, reverse=True)  # => [b + c, c, 0]
/// ```
///
/// - Parameters:
///     - x: A `Tensor`. Must be one of the following types: `float32`, `float64`,
///         `int64`, `int32`, `uint8`, `uint16`, `int16`, `int8`, `complex64`,
///         `complex128`, `qint8`, `quint8`, `qint32`, `half`.
///     - axis: A `Tensor` of type `int32` (default: 0). Must be in the range
///         `[-rank(x), rank(x))`.
///
/// - Attrs:
///     - exclusive: If `True`, perform exclusive cumsum.
///     - reverse: A `bool` (default: False).
@inlinable @inline(__always)
public static func cumsum<
    T: Numeric & TensorFlowScalar,
    Tidx: BinaryInteger & TensorFlowScalar
>(
    _ x: Tensor<T>,
    axis: Tensor<Tidx>,
    exclusive: Bool = false,
    reverse: Bool = false
) -> Tensor<T> {
  let nOutputs = Int(1)
    let op = makeOp("Cumsum", nOutputs)
    op.updateAttribute("exclusive", exclusive)
    op.updateAttribute("reverse", reverse)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("Tidx", Tidx.tensorFlowDataType)
    op.addInput(x)
    op.addInput(axis)
