///
///     index = [ 2]
///             [10]
///     values = [4, 5]
///     shape = [30]
///
/// then the final deserialized `SparseTensor` will be:
///
///     index = [0  0]
///             [0 10]
///             [0 20]
///             [1  2]
///             [1 10]
///     values = [1, 2, 3, 4, 5]
///     shape = [2 50]
///
/// - Parameter serialized_sparse: 2-D, The `N` serialized `SparseTensor` objects.
///     Must have 3 columns.
///
/// - Attr dtype: The `dtype` of the serialized `SparseTensor` objects.
