  let nOutputs = Int(1) + Int(1) + Int(1)
    let op = makeOp("DeserializeManySparse", nOutputs)
    op.updateAttribute("dtype", Dtype.tensorFlowDataType)
    op.addInput(serializedSparse)
    return op.execute(Int(1), Int(1), Int(1))
}

