  let nOutputs = Int(1)
    let op = makeOp("ResizeArea", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("align_corners", alignCorners)
    op.addInput(images)
    op.addInput(size)
    return op.execute(Int(1))
}

