/// Update '*var' according to the AdaMax algorithm.
///
/// m_t <- beta1 * m_{t-1} + (1 - beta1) * g
/// v_t <- max(beta2 * v_{t-1}, abs(g))
/// variable <- variable - learning_rate / (1 - beta1^t) * m_t / (v_t + epsilon)
///
/// - Parameters:
///     - var: Should be from a Variable().
///     - m: Should be from a Variable().
///     - v: Should be from a Variable().
///     - beta1_power: Must be a scalar.
///     - lr: Scaling factor. Must be a scalar.
///     - beta1: Momentum factor. Must be a scalar.
///     - beta2: Momentum factor. Must be a scalar.
///     - epsilon: Ridge term. Must be a scalar.
///     - grad: The gradient.
///
/// - Attr use_locking: If `True`, updating of the var, m, and v tensors will be protected
///     by a lock; otherwise the behavior is undefined, but may exhibit less
///     contention.
@inlinable @inline(__always)
public static func resourceApplyAdaMax<T: Numeric & TensorFlowScalar>(
    var_: ResourceHandle,
    m: ResourceHandle,
    v: ResourceHandle,
    beta1Power: Tensor<T>,
    lr: Tensor<T>,
    beta1: Tensor<T>,
    beta2: Tensor<T>,
    epsilon: Tensor<T>,
    grad: Tensor<T>,
    useLocking: Bool = false
) {
  let nOutputs = 0
    let op = makeOp("ResourceApplyAdaMax", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("use_locking", useLocking)
    op.addInput(var_)
    op.addInput(m)
    op.addInput(v)
    op.addInput(beta1Power)
    op.addInput(lr)
    op.addInput(beta1)
    op.addInput(beta2)
    op.addInput(epsilon)
    op.addInput(grad)
    op.execute()
}

/// Update '*var' according to the adadelta scheme.
///
/// accum = rho() * accum + (1 - rho()) * grad.square();
/// update = (update_accum + epsilon).sqrt() * (accum + epsilon()).rsqrt() * grad;
/// update_accum = rho() * update_accum + (1 - rho()) * update.square();
/// var -= update;
///
/// - Parameters:
///     - var: Should be from a Variable().
///     - accum: Should be from a Variable().
///     - accum_update: Should be from a Variable().
///     - lr: Scaling factor. Must be a scalar.
///     - rho: Decay factor. Must be a scalar.
///     - epsilon: Constant factor. Must be a scalar.
///     - grad: The gradient.
///
/// - Attr use_locking: If True, updating of the var, accum and update_accum tensors will be protected by
///     a lock; otherwise the behavior is undefined, but may exhibit less contention.
@inlinable @inline(__always)
public static func resourceApplyAdadelta<T: Numeric & TensorFlowScalar>(
    var_: ResourceHandle,
    accum: ResourceHandle,
    accumUpdate: ResourceHandle,
    lr: Tensor<T>,
    rho: Tensor<T>,
    epsilon: Tensor<T>,
    grad: Tensor<T>,
    useLocking: Bool = false
) {
  let nOutputs = 0
    let op = makeOp("ResourceApplyAdadelta", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("use_locking", useLocking)
    op.addInput(var_)
    op.addInput(accum)
    op.addInput(accumUpdate)
    op.addInput(lr)
    op.addInput(rho)
    op.addInput(epsilon)
    op.addInput(grad)
    op.execute()
}

/// Update '*var' according to the adagrad scheme.
///
/// accum += grad * grad
/// var -= lr * grad * (1 / sqrt(accum))
///
/// - Parameters:
///     - var: Should be from a Variable().
///     - accum: Should be from a Variable().
///     - lr: Scaling factor. Must be a scalar.
///     - grad: The gradient.
///
/// - Attr use_locking: If `True`, updating of the var and accum tensors will be protected
///     by a lock; otherwise the behavior is undefined, but may exhibit less
///     contention.
@inlinable @inline(__always)
public static func resourceApplyAdagrad<T: Numeric & TensorFlowScalar>(
    var_: ResourceHandle,
    accum: ResourceHandle,
    lr: Tensor<T>,
    grad: Tensor<T>,
    useLocking: Bool = false,
    updateSlots: Bool = true
) {
  let nOutputs = 0
    let op = makeOp("ResourceApplyAdagrad", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("use_locking", useLocking)
    op.updateAttribute("update_slots", updateSlots)
    op.addInput(var_)
    op.addInput(accum)
    op.addInput(lr)
    op.addInput(grad)
    op.execute()
}

/// Update '*var' according to the proximal adagrad scheme.
///
/// - Parameters:
///     - var: Should be from a Variable().
///     - gradient_accumulator: Should be from a Variable().
///     - gradient_squared_accumulator: Should be from a Variable().
///     - grad: The gradient.
///     - lr: Scaling factor. Must be a scalar.
///     - l1: L1 regularization. Must be a scalar.
///     - l2: L2 regularization. Must be a scalar.
///     - global_step: Training step number. Must be a scalar.
///
/// - Attr use_locking: If True, updating of the var and accum tensors will be protected by
///     a lock; otherwise the behavior is undefined, but may exhibit less contention.
@inlinable @inline(__always)
public static func resourceApplyAdagradDA<T: Numeric & TensorFlowScalar>(
    var_: ResourceHandle,
    gradientAccumulator: ResourceHandle,
    gradientSquaredAccumulator: ResourceHandle,
