    op.updateAttribute("use_nesterov", useNesterov)
    op.addInput(var_)
    op.addInput(m)
    op.addInput(v)
    op.addInput(beta1Power)
    op.addInput(beta2Power)
    op.addInput(lr)
    op.addInput(beta1)
    op.addInput(beta2)
    op.addInput(epsilon)
    op.addInput(grad)
    op.execute()
}

/// Update '*var' according to the Adam algorithm.
