/// var = (sign(linear) * l1 - linear) / quadratic if |linear| > l1 else 0.0
/// accum = accum_new
///
/// - Parameters:
///     - var: Should be from a Variable().
///     - accum: Should be from a Variable().
///     - linear: Should be from a Variable().
///     - grad: The gradient.
///     - lr: Scaling factor. Must be a scalar.
