///     by a lock; otherwise the behavior is undefined, but may exhibit less
///     contention.
@inlinable @inline(__always)
public static func resourceSparseApplyFtrl<
    T: Numeric & TensorFlowScalar,
    Tindices: BinaryInteger & TensorFlowScalar
