    tableName: String,
    numShards: Int64,
    shardId: Int64
) -> (parameters: Tensor<Float>, accumulators: Tensor<Float>, updates: Tensor<Float>, gradientAccumulators: Tensor<Float>) {
  let nOutputs = Int(1) + Int(1) + Int(1) + Int(1)
