/// Adds up a SparseTensor and a dense Tensor, using these special rules:
///
/// (1) Broadcasts the dense side to have the same shape as the sparse side, if
///     eligible;
/// (2) Then, only the dense values pointed to by the indices of the SparseTensor
///     participate in the cwise addition.
///
/// By these rules, the result is a logical SparseTensor with exactly the same
/// indices and shape, but possibly with different non-zero values.  The output of
/// this Op is the resultant non-zero values.
///
/// - Parameters:
///     - sp_indices: 2-D.  `N x R` matrix with the indices of non-empty values in a
///         SparseTensor, possibly not in canonical ordering.
///     - sp_values: 1-D.  `N` non-empty values corresponding to `sp_indices`.
///     - sp_shape: 1-D.  Shape of the input SparseTensor.
///     - dense: `R`-D.  The dense Tensor operand.
///
/// - Output output: 1-D.  The `N` values that are operated on.
@inlinable @inline(__always)
public static func sparseDenseCwiseAdd<T: Numeric & TensorFlowScalar>(
    spIndices: Tensor<Int64>,
    spValues: Tensor<T>,
    spShape: Tensor<Int64>,
    dense: Tensor<T>
) -> Tensor<T> {
  let nOutputs = Int(1)
    let op = makeOp("SparseDenseCwiseAdd", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.addInput(spIndices)
    op.addInput(spValues)
    op.addInput(spShape)
    op.addInput(dense)
    return op.execute(Int(1))
}

/// Component-wise divides a SparseTensor by a dense Tensor.
///
/// *Limitation*: this Op only broadcasts the dense side to the sparse side, but not
/// the other direction.
///
/// - Parameters:
///     - sp_indices: 2-D.  `N x R` matrix with the indices of non-empty values in a
///         SparseTensor, possibly not in canonical ordering.
///     - sp_values: 1-D.  `N` non-empty values corresponding to `sp_indices`.
///     - sp_shape: 1-D.  Shape of the input SparseTensor.
///     - dense: `R`-D.  The dense Tensor operand.
///
/// - Output output: 1-D.  The `N` values that are operated on.
@inlinable @inline(__always)
public static func sparseDenseCwiseDiv<T: Numeric & TensorFlowScalar>(
    spIndices: Tensor<Int64>,
    spValues: Tensor<T>,
    spShape: Tensor<Int64>,
    dense: Tensor<T>
) -> Tensor<T> {
  let nOutputs = Int(1)
    let op = makeOp("SparseDenseCwiseDiv", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.addInput(spIndices)
    op.addInput(spValues)
    op.addInput(spShape)
    op.addInput(dense)
    return op.execute(Int(1))
}

/// Component-wise multiplies a SparseTensor by a dense Tensor.
///
/// The output locations corresponding to the implicitly zero elements in the sparse
/// tensor will be zero (i.e., will not take up storage space), regardless of the
/// contents of the dense tensor (even if it's +/-INF and that INF*0 == NaN).
///
/// *Limitation*: this Op only broadcasts the dense side to the sparse side, but not
/// the other direction.
///
/// - Parameters:
///     - sp_indices: 2-D.  `N x R` matrix with the indices of non-empty values in a
///         SparseTensor, possibly not in canonical ordering.
///     - sp_values: 1-D.  `N` non-empty values corresponding to `sp_indices`.
///     - sp_shape: 1-D.  Shape of the input SparseTensor.
///     - dense: `R`-D.  The dense Tensor operand.
///
/// - Output output: 1-D.  The `N` values that are operated on.
@inlinable @inline(__always)
public static func sparseDenseCwiseMul<T: Numeric & TensorFlowScalar>(
    spIndices: Tensor<Int64>,
    spValues: Tensor<T>,
    spShape: Tensor<Int64>,
    dense: Tensor<T>
