  let nOutputs = Int(1)
    let op = makeOp("Squeeze", nOutputs)
    op.updateAttribute("T", T.tensorFlowDataType)
    op.updateAttribute("squeeze_dims", squeezeDims)
    op.addInput(input)
    return op.execute(Int(1))
}

